import React from 'react';
import '../assets/css/App.css';
import '../assets/js/Segmentation.js'

// import components
import Header from '../components/Header'
import Container from '../components/Container'


function App() {
  return (
    <div className="App">
      <script defer src="https://cdn.jsdelivr.net/npm/@tensorflow/tfjs@2.4.0/dist/tf.min.js" integrity="sha256-ab08IYO0pzegsMiph4FJBj/nHxcxe3k20Yr22XMCeE4=" crossorigin="anonymous">
      </script>
      <script defer src="https://cdn.jsdelivr.net/npm/@tensorflow-models/body-pix@2.0.5/dist/body-pix.min.js" integrity="sha256-y8hgQ+SI0u26/C+l6+qznd5isuLIyuvF0DZvvv780Nk=" crossorigin="anonymous">
      </script>
      <header className="App-header">
        <Header />
        <hr></hr>
      </header>
      <div class="container-fluid">
        <div class="row d-flex justify-content-center">
          <div class="col-5 border">
            <Container />
          </div>
        </div>
        </div>
    </div>
  );
}

export default App;
